value.value:
{
    // Test 2: Remove multiple elements
    obj = all(`test.transient:Main`).firstElement();

    // Get current collection size (should be 4 after previous test)
    currentSize = $obj.get(`test.transient:Main#coll`).size();

    // Remove two elements: "1" and "5"
    toRemove1 = all(`test.transient:Second`).filter(x -> $x.toString().equals("1")).firstElement();
    toRemove2 = all(`test.transient:Second`).filter(x -> $x.toString().equals("5")).firstElement();
    toRemoveList = list($toRemove1, $toRemove2);

    $obj.remove(`test.transient:Main#coll`, $toRemoveList);

    // Should now have 2 elements remaining
    $obj.get(`test.transient:Main#coll`).size() == 2
}

{
    // Test 3: Remove non-existent elements
    obj = all(`test.transient:Main`).firstElement();

    // Try to remove an element that doesn't exist in the collection
    nonExistent = all(`test.transient:Second`).filter(x -> $x.toString().equals("99")).firstElement();

    sizeBefore = $obj.get(`test.transient:Main#coll`).size();
    $obj.remove(`test.transient:Main#coll`, $nonExistent);
    sizeAfter = $obj.get(`test.transient:Main#coll`).size();

    // Size should remain unchanged
    $sizeBefore == $sizeAfter && $sizeAfter == 2
}

{
    // Test 4: Remove all remaining elements
    obj = all(`test.transient:Main`).firstElement();

    // Get all remaining elements in the collection
    remainingElements = $obj.get(`test.transient:Main#coll`);

    // Remove all remaining elements
    $obj.remove(`test.transient:Main#coll`, $remainingElements);

    // Collection should now be empty
    $obj.get(`test.transient:Main#coll`).size() == 0
}

{
    // Test 5: Remove from empty collection (edge case)
    obj = all(`test.transient:Main`).firstElement();

    // Try to remove from already empty collection
    testElement = all(`test.transient:Second`).filter(x -> $x.toString().equals("1")).firstElement();

    sizeBefore = $obj.get(`test.transient:Main#coll`).size(); // Should be 0
    $obj.remove(`test.transient:Main#coll`, $testElement);
    sizeAfter = $obj.get(`test.transient:Main#coll`).size();

    // Size should remain 0 (no error should occur)
    $sizeBefore == 0 && $sizeAfter == 0
}

{
    // Test 6: Performance test - single element removal (optimization test)
    // Reset the collection for performance test
    obj = all(`test.transient:Main`).firstElement();

    // Add back multiple elements
    elementsToAdd = all(`test.transient:Second`);
    $obj.set(`test.transient:Main#coll`, $elementsToAdd);

    // Verify collection has elements
    initialSize = $obj.get(`test.transient:Main#coll`).size();

    // Test single element removal (should use optimized asSet path)
    singleElement = all(`test.transient:Second`).filter(x -> $x.toString().equals("2")).firstElement();
    $obj.remove(`test.transient:Main#coll`, $singleElement);

    finalSize = $obj.get(`test.transient:Main#coll`).size();

    // Should have removed exactly one element
    $initialSize > $finalSize && $finalSize == 4
}
